import LogoSVG from '../svg/logo.svg';
import BackgroundSVG from '../svg/background.svg';
import logoPNG from './logo-syn.png';
import back2 from '../svg/back2.svg';
import synLogo from '../svg/syn-logo.svg';

export const ImagePath = {
   LogoSVG,
   BackgroundSVG,
   logoPNG,
   back2,
   synLogo
}
